import axios from "axios";
import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import AdminTopicPanel from './AdminTopicPanel.js';
import { useHistory } from "react-router-dom";
import Button from 'react-bootstrap/Button';

  export default class AdminDashboard extends React.Component
{
  goPage = e => {
    this.props.history.push("/adminTopicPanel");
  };

    state = {
        persons: []
      }


 componentDidMount(){
        var auth = JSON.parse(localStorage.getItem('auth'));
        axios.get("http://localhost:8080/api/mentorapplication",auth).then(
            response => {
             const persons = response.data;
            this.setState({persons})
    })
}
render(){
    return(
    <div className="AdminDashboard">
        <h1> admin </h1>
        <h2>mentor app : </h2>
        <ul>
           { this.state.persons.map(person => <li> {person.id.toString() + person.menteeid.toString() +  person.details} </li>)}
        </ul>
        <Router>
            <div>
                <nav>
                    <Button onClick = {this.goPage}>
                      AdminTopicPanel
                    </Button >
                </nav>
            </div>
            <Route path="/adminTopicPanel" component = {AdminTopicPanel}>
</Route>
        </Router>

    </div>
    ) 
}}
